  },
  percentage: {
    height: theme.spacing(5),
    width: theme.spacing(5),
    position: "absolute",
    top: "30%",
    right: "0",
  }

}))


function Skills() {
  const classes = useStyles()
  return (
    <div style={{display:"flex", justifyContent:"center", alignItems:"center",}}>
      <div className={classes.bar} >
        <div className={classes.fill} style={{width: 400}}>
          <div className={classes.tag}>
            <span className={classes.span}>one</span></div>
        </div>
      </div>
       <span className={classes.span, classes.percentage}>92</span>
      </div>
  )
}

export default Skills
